import React from 'react';
import { Link, useParams }  from "react-router-dom";
import FormUser from '../components/FormUser';
export default function Adminform() {
  let { id } = useParams();
  const pimg = <img src={require("../images/noprofile.jpg")} alt="" style={{height:"100px"}}/>;
  return (
    <div class="content-wrapper">
      <div className="content-header">
        <div className="container-fluid">
          <div className="row mb-2">
            <div className="col-sm-5">
              <h1 className="m-0">Админ хэрэглэгч {id ? "засах":"нэмэх"}</h1>
              {pimg}
            </div>{/* /.col */}
            <div className="col-sm-2">
           <Link to="../admin"><button type="button" class="btn btn-block btn-primary btn-sm">Буцах</button></Link>
            </div>
          </div>{/* /.row */}
        </div>{/* /.container-fluid */}
      </div> 
      <div className="content">
        <div className="container-fluid">
          <div className="row">
            <FormUser role="Admin"/>
          </div>
        </div>
      </div>
    </div>
  )
}
